import { Link } from 'react-router-dom';

import DailyLogForm from "./dailylog.js";

function MainPage() {
    return (
        <>
            <div className="container ">
                <div className="row mb-2 p-5">
                    <Link to={"/dashboard"}><h2 className="text-center goto-dashboard">Go To Dashboard</h2></Link>
                    <hr/>
                    <DailyLogForm/>
                </div>

            </div>
        </>
    );
}

export default MainPage;
